class FileModel {
  String _name;
  String _ext;
  String _size;
  String _fsize;
  String _fileUrl;
  String _path;
  String _bigPath;
  Uint8List _data;
  String _id;


  Uint8List get data => _data;

  set data(Uint8List value) {
    _data = value;
  }

  String get name => _name;
  String get ext => _ext;
  String get size => _size;
  String get fsize => _fsize;
  String get fileUrl => _fileUrl;
  String get path => _path;
  String get bigPath => _bigPath;
  String get id => _id;


  FileModel.fromJson(dynamic json) {
    _name = json["name"];
    _ext = json["ext"];
    _size = json["size"]?.toString();
    _fsize = json["fsize"];
    _fileUrl = json["fileUrl"];
    _path = json["path"];
    _bigPath = json["bigPath"];
    _id = json["id"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["name"] = _name;
    map["ext"] = _ext;
    map["size"] = _size;
    map["fsize"] = _fsize;
    map["fileUrl"] = _fileUrl;
    map["path"] = _path;
    map["bigPath"] = _bigPath;
    map["id"] = _id;
    return map;
  }

}